clear;
% rng(1)
% Define a marker database
markers = {'o', 's', 'd', '*', '^', 'p', 'h'}; % Circle, square, diamond, star, triangle, pentagon, hexagon
colors = {'r', 'g', 'b', 'm', 'c', 	"#EDB120", 'k',"#A2142F"}; % Red, green, blue, magenta, cyan, yellow, black
tic;

Central.delta = 0.01;
Central.N_UnitCell = 3;
Central.N_row = 10; %[control:editfield:5677]{"position":[17,19]}
Central.N_col = 1000; %[control:editfield:7e4d]{"position":[17,21]}
BoundaryCond = "OBC"; %[control:dropdown:4a46]{"position":[16,21]}
Central.BoundaryCond = BoundaryCond;
Central.Jdelta = 10;
Central.J = Central.Jdelta / Central.delta;
% Central.J = 1000;
Central.epsilon = 0 * ones(1,Central.N_UnitCell);
Central.mu = 0;
% 中心区其他量
% 总格点数
N_tot_site = Central.N_row * Central.N_col * Central.N_UnitCell;
N_Cells = Central.N_row * Central.N_col;
% 每列格点数
A = 1; B = 2; C = 3;
N_site_pcol = Central.N_row * Central.N_UnitCell;
% 跃迁
t = -1;
% Fermi Energy
FermiEnergy = 0;
% Disorder samplings
N_Disorder = 11; %[control:editfield:9769]{"position":[14,16]}
Disorder = linspace(1e-3,5000,N_Disorder);

Width = [3,5,7, 9, 11, 13, 15];

LocLength = zeros(length(Width), length(Disorder));
% Loop for disorder and delta simutaneously
for jj = 1:length(Width)
    Central.J = Central.Jdelta / Central.delta;
    J_plus = Central.J*(1 + Central.delta);
    J_minus = Central.J*(1 - Central.delta);
    Central.N_row = Width(jj);
    if Central.N_row < 2
            [H_CC, V_CC] = Hamiltonian_Lieb_1D(Central.epsilon, J_minus, J_plus);
        else
            [H_CC, V_CC] = Lieb_2D_Hamiltonian(Central.epsilon,J_plus,J_minus,J_minus,Central.N_row, BoundaryCond);
    end
    r = rank(V_CC);
    R = eye(size(H_CC,1));
    R_Spectrum = zeros(2*r, Central.N_col);
    for kk = 1:length(Disorder)
        for ii = 1:Central.N_col
            if ii > 1
                T = Transfer_Matrix(H_CC, V_CC, FermiEnergy, Disorder(kk))*Q;
            else
                T = Transfer_Matrix(H_CC, V_CC, FermiEnergy, Disorder(kk));
            end
            [Q, R] = qr(T);
            [R_diag, ind] = sort(diag(R), 'descend','ComparisonMethod','abs');
            Q = Q(:, ind);
            R_Spectrum(:, ii) = abs(R_diag);
        end
        lnR = log(R_Spectrum);        
        Lyapunov_Spectrum = sum(lnR,2)/Central.N_col;        
    % The minimal Lyapunov exponent corresponds to the largest localization
    % length
        LocLength(jj, kk) = 1./min(abs(Lyapunov_Spectrum));
    end
end
%%
figure %[output:38000f1c]
plot(Disorder, LocLength./Width','o-'); %[output:38000f1c]
% ylim([0,1.2])
xlabel('Disorder') %[output:38000f1c]
ylabel('\xi/M') %[output:38000f1c]
legend(arrayfun(@(x) ['M =' num2str(x)], Width, 'UniformOutput',false)) %[output:38000f1c]
% yscale log
% xscale log
hold off %[output:38000f1c]

Lambda = LocLength ./ Width';
%[text] 利用拟合得到$\\xi\_\\infty$
figure; xscale log; yscale log; hold on %[output:2d8d1d7e]

eqn = 'log(1+k*xi/x)/k'; startpoint = [1,1]; Lower = [0,0];

xi_infty = zeros(1,length(Disorder));
xi_over_Width = zeros(length(Width), length(Disorder));

for ii = 1:length(Disorder)
    ind = ~isnan(Lambda(:, ii));
    f = fit(Width(ind(2:end))', Lambda(ind(2:end), ii), eqn, "startpoint",startpoint,"lower",Lower);
    xi_infty(ii) = f.xi;
    xi_over_Width(:, ii) = xi_infty(ii)./Width;    
    PlotFlag = "Fit"; %[control:dropdown:1492]{"position":[16,21]}
    if PlotFlag == "Fit"
        xscale log; yscale log %[output:2d8d1d7e]
        p1 = plot(Width, Lambda(:, ii),'o','DisplayName',['W=',num2str(Disorder(ii))]);
        p2 = plot(Width, f(Width),'-','LineWidth',2,'DisplayName',['\xi=',num2str(f.xi)]);
        xlabel('$M$','Interpreter','latex')
        ylabel('$\Lambda$','Interpreter','latex')
        % pause 
    else
        % Scaling plot
        xi_infty(ii) = f.xi; % Fit parameter of xi_infty for a given width
        p = plot(xi_over_Width(:, ii), Lambda(:,ii),'.','DisplayName',['\Gamma=',num2str(Disorder(ii))]);
        p.LineStyle = '-';
        p.Marker = markers{mod(ii,length(markers))+1};
        p.MarkerEdgeColor=colors{mod(ii,length(colors))+1};
        p.MarkerSize = 6;
    end
end
legend %[output:2d8d1d7e]

